-56cd-4cd5-8584-346f3fe7e3af,c6c831e1-9f08-4393-9d1c-bd8ff5813ba5,bea2008e-a9c1-4d61-82a5-1be97b380f69,8f31b56f-1135-4498-8832-0f8b7cfe1556,d04e5f72-5bd2-4f00-b236-c3064cfb06ee,e8ef9081-f7d3-4e1c-90e7-85e3776f3bb4}', '1977-01-01', 121, 'Ru', '???', 0, '{https://kinopoiskapiunofficial.tech/images/posters/kp/333.jpg}', '{https://kinopoiskapiunofficial.tech/images/posters/kp/333.jpg}', 'Татуин. Планета-пустыня. Уже постаревший рыцарь Джедай Оби Ван Кеноби спасает молодого Люка Скайуокера, когда тот пытается отыскать пропавшего дроида. С этого момента Люк осознает свое истинное назначение: он один из рыцарей Джедай. В то время как гражданская война охватила галактику, а войска повстанцев ведут бои против сил злого Императора, к Люку и Оби Вану присоединяется отчаянный пилот-наемник Хан Соло, и в сопровождении двух дроидов, R2D2 и C-3PO, этот необычный отряд отправляется на поиски предводителя повстанцев – принцессы Леи. Героям предстоит отчаянная схватка с устрашающим Дартом Вейдером – правой рукой Императора и его секретным оружием – «Звездой Смерти».', false, false, 'zvezdnye-voiny:-epizod-4-—-novaia-nadezhda');
